pragma solidity ^0.5.10;

import "../multisig/SignerManager.sol";

contract SignerManagerMock is SignerManager {

    /////
    // Public functions:
    /////

    /**
     * @dev Allow tests to call `onlySelf` functions.
     */
    function callSelf(bytes memory _data)
        public
        returns (bool success)
    {
        success = _execute(address(this), uint(0), gasleft(), _data);
        require(success, "call-failed");
    }

    /**
     * @dev Exposes the internal `_setupSigners` function.
     */
    function setupSigners(
        address[] memory _signers,
        uint256 _threshold
    )
        public
    {
        _setupSigners(_signers, _threshold);
    }

    /**
     * @dev Exposes the internal `_addSigner` function.
     */
    function addSigner(address _signer)
        public
    {
        _addSigner(_signer);
    }

    /**
     * @dev Exposes the internal _removeSigner function.
    */
    function removeSigner(
        address _prevSigner,
        address _signer
    )
        public
    {
        _removeSigner(_prevSigner, _signer);
    }

    /**
     * @dev Exposes the internal _setThreshold function.
     */
    function setThreshold(uint _threshold) public {
        _setThreshold(_threshold);
    }

    /////
    // Internal functions:
    /////

    function _execute(
        address _dst,
        uint256 _val,
        uint256 _gas,
        bytes memory _data
    )
        internal
        returns (bool success)
    {
        assembly {
            // call(gas, dst, value, argsOffset, argsLen, retOffset, retLen)
            // call to the _dst address with gas _gas, value _val (in wei),
            // and the _data
            success := call(_gas, _dst, _val, add(_data, 0x20), mload(_data), 0, 0)
        }
    }
}
